import React, { Component } from 'react'
import Logout from '../../Logout'
import axios from 'axios';

export default class ArticleList extends Component {
    componentDidMount() {
        axios.get('/api/user').
        then( res => {
            console.log(res)
        })
    }
    render() {   
        return (  
            <div className="ArticleList">
                <ul className="AritleListContainer">
                    <li> id:0 post one author:kim </li>
                    <li> id:1 post two author:park</li>
                    <li> id:2 post three author:jim</li>
                </ul>

                <button className="ArticleCreate" id="create-article-button" name="create-article-button">Create</button>
                <Logout />
            </div>

        )
    }
}
